      TweenMax.set(`#${id}`, {fill:'orange'})
    },
    allReset(){
      TweenMax.set([`#p1 #show`, `#p2 #show`, `#p3 #show`], {display:'none'})
      TweenMax.set([`#p1 #hidden`, `#p2 #hidden`, `#p3 #hidden`], {display:'none'})
